"     Patient information: Acute cerebellar ataxia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/acute-cerebellar-ataxia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H2296148\">",
"      <span class=\"h1\">",
"       What is acute cerebellar ataxia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Acute cerebellar ataxia is a condition that causes people to suddenly become unable to coordinate their movements. It most often affects children between the ages of 2 and 5, but it can affect older people, too.",
"     </p>",
"     <p>",
"      Acute cerebellar ataxia usually happens in response to an infection that causes fever. For example, some children get it after having chickenpox.",
"     </p>",
"     <p>",
"      The symptoms of acute cerebellar ataxia usually go away on their own within 2 to 3 weeks.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2296163\">",
"      <span class=\"h1\">",
"       What are the symptoms of acute cerebellar ataxia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptom is usually trouble walking, but other movement problems can also occur. Some children also develop:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Jumpy or flicking eyeball movements",
"       </li>",
"       <li>",
"        Trouble speaking clearly",
"       </li>",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2296178\">",
"      <span class=\"h1\">",
"       Will my child need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably. If your child has symptoms of acute cerebellar ataxia, the doctor or nurse will want to make sure those symptoms are not caused by a more serious problem, such as brain damage. He or she will ask a lot of questions about your child&rsquo;s symptoms and medical history. As part of the exam, the doctor or nurse will also need to watch how your child responds to different things and how he or she moves.",
"     </p>",
"     <p>",
"      The doctor or nurse might also order:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Blood tests to check for poisons or drugs (for example, if there is a chance the child accidentally swallowed something)",
"       </li>",
"       <li>",
"        Blood tests to check for low blood sugar, or other problems",
"       </li>",
"       <li>",
"        Imaging tests to check for problems in the brain",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2296193\">",
"      <span class=\"h1\">",
"       How is acute cerebellar ataxia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Acute cerebellar ataxia usually gets better on its own without treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2296208\">",
"      <span class=\"h1\">",
"       Is there anything I can do to help my child?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Give your child a lot of support. Let him or her know that things will get better. Also, keep a close watch on your child&rsquo;s symptoms and let the doctor know if they get worse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2296223\">",
"      <span class=\"h1\">",
"       Can acute cerebellar ataxia be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can lower the chances that your child will get acute cerebellar ataxia by making sure he or she has all the right vaccines. Some of the infections that lead to acute cerebellar ataxia (such as chickenpox, measles, and mumps) can be prevented with vaccines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2296238\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?27/22/28003?source=see_link\">",
