"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: High blood pressure in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/high-blood-pressure-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1240667263\">",
"      <span class=\"h1\">",
"       How do I know if my child has high blood pressure?",
"      </span>",
"      &nbsp;&mdash;&nbsp;At your child&rsquo;s regular checkup, your doctor or nurse will check your child&rsquo;s blood pressure. He or she will compare your child&rsquo;s blood pressure to the blood pressure of other children of the same age, sex, and height. If your child&rsquo;s blood pressure is much greater than the blood pressure of other children of the same age, sex, and height, your doctor or nurse will check it again on one or more other days.",
"     </p>",
"     <p>",
"      Children have high blood pressure if their blood pressure is much greater than that of other children on 3 or more different days. Another word for high blood pressure is &ldquo;hypertension.&rdquo;",
"     </p>",
"     <p>",
"      Some children have a condition called &ldquo;pre-hypertension.&rdquo; These children have blood pressure that is greater than normal, but is not yet high blood pressure.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667270\">",
"      <span class=\"h1\">",
"       What are the symptoms of high blood pressure?",
"      </span>",
"      &nbsp;&mdash;&nbsp;High blood pressure does not usually cause any symptoms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667277\">",
"      <span class=\"h1\">",
"       Why does my child have high blood pressure?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes, high blood pressure is caused by a medical condition. Other times, there is no known cause. High blood pressure can run in families.",
"     </p>",
"     <p>",
"      Your doctor or nurse will want to figure out if a medical condition is causing your child&rsquo;s high blood pressure. He or she will talk with you and do an exam. During the exam, he or she will check the blood pressure in your child&rsquo;s arms and legs. Your doctor or nurse might also do:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Lab tests",
"       </li>",
"       <li>",
"        Ultrasounds of the heart and kidneys, or other imaging tests &ndash; Imaging tests can create pictures of the inside of the body.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667284\">",
"      <span class=\"h1\">",
"       Why does high blood pressure need to be treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;High blood pressure needs to be treated, because it can lead to future problems.",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Children with high blood pressure can have high blood pressure as adults. Adults with high blood pressure have a greater chance of having a heart attack or stroke.",
"       </li>",
"       <li>",
"        A few children with very high blood pressure can have seizures or heart failure. Heart failure is a type of heart problem in which the heart cannot pump normally.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The goal of treatment is to reduce your child&rsquo;s high blood pressure until it is at a normal level. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667291\">",
"      <span class=\"h1\">",
"       How is high blood pressure treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;First, doctors treat any medical conditions that might be causing the high blood pressure.",
"     </p>",
"     <p>",
"      But treating the cause does not always reduce high blood pressure. Or there might not be a known cause. In these cases, high blood pressure is treated with:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Lifestyle changes",
"       </li>",
"       <li>",
"        Medicines",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667298\">",
"      <span class=\"h1\">",
"       What lifestyle changes might be part of treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Lifestyle changes that might be part of treatment include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Losing weight (if your child is overweight) &ndash; Your doctor or nurse might recommend that you work with a &ldquo;nutritionist.&rdquo; A nutritionist is an expert on food and eating.",
"       </li>",
"       <li>",
"        Diet changes, such as eating healthier foods or reducing the amount of salt in your child&rsquo;s food. Healthy foods include fruits, vegetables, and low-fat dairy foods.",
"       </li>",
"       <li>",
"        Getting regular exercise &ndash; Most children should get &ldquo;aerobic&rdquo; exercise for 20 to 30 minutes a day, most days of the week. Aerobic exercise includes activities such as walking, running, swimming, or biking. Your doctor or nurse will tell you if there are activities your child should not do.",
"       </li>",
"       <li>",
"        Not spending a lot of time sitting, watching TV, or playing computer games",
"       </li>",
"       <li>",
"        Not smoking or drinking alcohol &ndash; Doctors also recommend that family members not smoke. Children who breathe in smoke can get heart problems.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667305\">",
"      <span class=\"h1\">",
"       What medicines might be part of treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors can use different types of medicines to treat high blood pressure. The medicines work in different ways and can have different side effects. Your doctor will work with you to find the medicine that is right for your child.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667312\">",
"      <span class=\"h1\">",
"       When do I follow up with my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will follow up with you and your child on a regular basis. On each visit, he or she will check your child&rsquo;s blood pressure. Let your doctor or nurse know if you have any problems with treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1240667319\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?30/52/31554?source=see_link\">",
"       Patient information: Weight loss treatments (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?17/12/17601?source=see_link\">",
"       Patient information: Heart failure (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?23/55/24435?source=see_link\">",
