"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?37/28/38337?source=see_link\">",
"       Patient information: High blood pressure in children (Beyond the Basics)",
"      </a>",
"      <br/>",
