"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?38/61/39890?source=see_link\">",
"       Patient information: Low sodium diet (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
