"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?36/26/37289?source=related_link\">",
"      Prevention of varicella-zoster virus infection: Chickenpox",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?35/22/36200?source=related_link\">",
"      Prevention of varicella-zoster virus infection: Herpes zoster",
