var title_f29_37_30299="Class infantile seizures";
var content_f29_37_30299=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F53102&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F53102&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Proposed classification of infantile seizures (2 to 24 months)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Astatic",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Sudden loss of muscle tone that may be focal (eg, head nod), hemibody or generalized (eg, fall or drop attack)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Behavioral",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Abrupt change in behavior without other overt features (usually becomes quiet-hypomotor), occasionally autonomic signs (pallor, cyanosis, etc.)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Clonic",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Clonic jerking, usually of extremities or eyelids, occasionally followed by tonic posturing.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Infantile spasms",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       May be myoclonic or brief tonic flexor (adduction of arms with forward flexion of head and trunk) or extensor (abduction of arms with backward extension of head and trunk) spasms. These often occur in clusters.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Tonic",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Symmetric or asymmetric posturing (occasional \"fencer posture\"), may be followed by focal or generalized clonic activity.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Versive",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       A forced and sustained tonic deviation of the eyes that is usually associated with ipsilateral turning of the head and rotation of the trunk.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Unclassified",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted form Nordii, DR, Bazil, CW, Scheur, ML, Pedley, TA, Epilepsia 1997; 38:553 and Acharya, JN, Wylie, E, Luders, HO, et al, Neurology 1997; 48:189.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
